def safer_up_to_index(aString, n):
  if n > len(aString):
    return None
  result = aString[:n]
  return result
  if n >= len(aString):
    return aString[n:]

def safer_after_index(aString, n):
  if n > len(aString):
    return None
  result = aString[n:]
  return result
  if n >= len(aString):
    return aString[:n]

def capitalize(s):
  result = s.upper()
  return result
  result = s
  for c in s: 
    c.upper()

def lowercase(s):
  result = s.lower()
  return result
  result = s
  for c in s: 
    c.lower()

def find_any(a,b):
  a = a.upper()
  b = b.upper()
  return a.find(b)
  return b.find(a)
  a = a.lower()
  b = b.lower()

def swap_case(s):
  result = ''
  for c in s:
    if c == c.upper():
      result += c.lower()
    else: result += c.upper()
  return result
